import React from "react";
import "./SignOut.css";
import Navbar from "../components/Navbar.js";


class SignOut extends React.Component {
  constructor(props) {
		super(props);
  }

  componentDidMount() {
  	sessionStorage.clear();
    setTimeout(function() {
      window.location.href = "/";
    }, 500);
  }

  render() {
    return (
      <>
        <Navbar page="Signout" />

        <div style={{fontWeight: 'bold', fontSize: '1.1rem'}}>Signing Out ...</div>

      </>
    );
  }
}
export default SignOut;
